Asa Akira, Erik Everhard, Gracie Glam, James Deen, Jayden Jaymes, Kristina Rose, Manuel Ferrara, Nyomi Banxxx, Phoenix Marie, Toni Ribas, Tori Black

Adult entertainment studio, Elegant Angel, is releasing the latest volume of its annual series, &quot;Performers Of The Year 2011.&quot; The movie is a 2-Disc Set, featuring 7 scenes, and starring the biggest names of the year: Asa Akira, Tori Black, Kristina Rose, Gracie Glam, Jayden Jaymes, Nyomi Banxxx, and Phoenix Marie.
